?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: Times New Roman;">Данная компания по производству часов была создана молодым дизайнером и часовщиком Романом Волаком. После долгих творческих раздумий, он принял решение о создании своей собственной часовой фирмы. Для того чтобы найти собственный дизайн, он изучал историю каждой известной часовой компании. И вскоре ему удалось найти «золотую середину». Он изобрел неповторимый дизайн часов под названием MDV. Это эксклюзивная технология, которая состоит из 8-ми слойного светящегося материала (к тому же, этот материал является фотолюминесцентным). Циферблаты, обладающие данной технологией, позволяют увидеть время абсолютно при любом освещении. Корпуса этих часов производятся из стали или вольфрамового карбида, а сапфировые стекла позволяют защитить часы от различных повреждений. Все корпуса выполнены в разнообразных стилях, поэтому каждый покупатель сможет найти именно то, что ему требуется. Стоит отметить, что помимо этого, каждая модель обладает водонепроницаемостью до 100 метров. На данный момент, компании принадлежат несколько спортивных коллекций, большинство из которых, выполнены в авангардном стиле. Кстати, компания Lum-Tec также производит и ограниченные коллекции часов. Одна из них –M Chrono, которая содержит всего 399 экземпляров. Сочетание высокого качества, надежность и оригинальный дизайн вот за что эта марка полюбилась часовой общественности. </span></span></p>
 
